import React, { useEffect, useState } from "react";
import Axios from "axios";

import NormalUser from "/Users/joshuasatlin/Documents/GitHub/FarmAlive_V0.3/farmalive/src/components/Auth/NormalUser.js";
import Mod from "/Users/joshuasatlin/Documents/GitHub/FarmAlive_V0.3/farmalive/src/components/Auth/Mod.js";
import Admin from "/Users/joshuasatlin/Documents/GitHub/FarmAlive_V0.3/farmalive/src/components/Auth/Admin.js";

export default function Main() {
  const [role, setRole] = useState("");

  Axios.defaults.withCredentials = true;
  useEffect(() => {
    Axios.get("http://localhost:3001/login").then((response) => {
      if (response.data.loggedIn == true) {
        setRole(response.data.user[0].role);
      }
    });
  }, []);

  return (
    <div>
      {role}
      <div>
        <h1>Mod</h1>
        <img src="https://www.google.com.br/images/branding/googlelogo/2x/googlelogo_color_160x56dp.png"></img>
      </div>
      {role == "visitor" && <NormalUser />}
      {role == "mod" && <Mod />}
      {role == "admin" && <Admin />}
    </div>
    // <div>
    //   <h1> Relax its working </h1>
    // </div>
  );
}
